val format_int_UDF = udf { (x: String) => 
    if (x.length() < 2) "0".concat(x)
    else x
}

spark.udf.register("format_int", format_int_UDF)

val format_time_UDF = udf { (x: String) => 
    if (x.length() < 3) "0".concat(x.substring(0, 1))
    else ((x.substring(0, 2)).concat(":")).concat(x.substring(2, 4))
}

spark.udf.register("format_time", format_time_UDF)

val format_timestamp_UDF = udf { (date: String, time: String, scheduled: String, previous: String, next: String) => 
    if (scheduled.charAt(0) == '0' && time.charAt(0) == '2') previous.concat("T").concat(time)
    else if (scheduled.charAt(0) == '2' && time.charAt(0) == '2') next.concat("T").concat(time)
    else date.concat("T").concat(time)
}

spark.udf.register("format_timestamp", format_timestamp_UDF)
